const personajes = ['Goku', 'Vegeta', 'Trunks'];
const [, , p3] = personajes;
console.log(p3);

const retornaArreglo = () => ['ABC', 123];

const [letras, numeros] = retornaArreglo();

console.log(letras, numeros);

// Tarea

const sabores = valor => {
  return [
    valor,
    () => {
      console.log('Hola mundo');
    }
  ];
};

const arr = sabores('Goku');

console.log(arr);
